#include<iostream>
#include<vector>
#include<string>
#include<algorithm>
#include<set>
#include<map>
using namespace std;


class Solution {
public:
    int countCharacters(vector<string>& words, string chars) {
        if(chars.size() == 0 || words.size() == 0)
            return 0;
        int count=0;
        sort(chars.begin(), chars.end());
        for(int i=0; i < words.size(); i++){
            if(isMatch(words[i], chars)){
                count += words[i].size();
            }
        }
        return count;
    }

    bool isMatch(string& s1, string s2){
        for(int i=0; i < s1.size(); i++){
            if(isFindChar(s1[i], s2) == false)
                return false;
        }
        return true;
    }

    bool isFindChar(char ch, string& s){
        for(int i=0; i < s.size(); i++){
            if(ch == s[i]){
                s.erase(i, 1);
                return true;
            }
            if(ch < s[i])
                return false;
        }
        return false;
    }
};

int main(){
    vector<string> s = {"cat","bt","hat","tree"};
    string chars = "atach";
    Solution a;
    a.countCharacters(s, chars);
}


